import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  NavLink,
} from "react-router-dom";

import HomePage from "./components/HomePage";
import Portfolio from "./Portfolio";

const Main = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/home" element={<HomePage />}></Route>
        <Route path="/">
          <HomePage />
        </Route>
      </Routes>
    </BrowserRouter>
  );
};

export default Main;
